style.css:
@-moz-document domain('www.aesgroup.com.tr') {


@media only screen and (min-width: 1000px) {
	@font-face {
		font-family: 'Quicksand';
		font-style: normal;
		font-weight: 400;
		font-display: swap;
		src: url(https://fonts.gstatic.com/s/quicksand/v30/6xK-dSZaM9iE8KbpRA_LJ3z8mH9BOJvgkP8o58i-wi40.woff2) format('woff2');
		unicode-range: U+0100-024F, U+0259, U+1E00-1EFF, U+2020, U+20A0-20AB, U+20AD-20CF, U+2113, U+2C60-2C7F, U+A720-A7FF;
	}
	@font-face {
		font-family: 'Quicksand';
		font-style: normal;
		font-weight: 400;
		font-display: swap;
		src: url(https://fonts.gstatic.com/s/quicksand/v30/6xK-dSZaM9iE8KbpRA_LJ3z8mH9BOJvgkP8o58a-wg.woff2) format('woff2');
		unicode-range: U+0000-00FF, U+0131, U+0152-0153, U+02BB-02BC, U+02C6, U+02DA, U+02DC, U+2000-206F, U+2074, U+20AC, U+2122, U+2191, U+2193, U+2212, U+2215, U+FEFF, U+FFFD;
	}
}
*,
textarea {
	font-family: Quicksand;
}
textarea {
	border: 1px solid #3D3F18;
}
.contact-list {
	font-family: Quicksand;
}
.h-light-baslik,
.h-big-baslik {
	text-shadow: none
}
.h-p,
.list-disc,
.title2,
p {
	text-align: justify;
	font-size: 18px;
	text-shadow: none
}
.h-detay a {
	text-align: justify;
	font-size: 18px;
	text-shadow: none;
	text-decoration: underline
}
.etkinlik-detay,
.loc,
.date,
.decs,
.arsiv-link,
.f-head,
.f-contact,
.sm-container,
.button {
	text-shadow: 1px 1px 1px #000;
}
div.etkinlik-slide {
	background-image: linear-gradient(to right top, #45ae77, #1ba78b, #009e99, #1894a0, #3a899f) !important;
}
#mc_embed_signup_scroll.button {
	background: #A4AA40;
}
.button:hover {
	cursor: pointer;
	color: #00B5D1;
}
.uk-container a {
	text-shadow: 0;
}
.arsiv-link {
	color: #f2f2f2
}
.f-contact a {
	color: #f2f2f2
}
.f-contact a:hover {
	color: #00B5D1
}
.arsiv-link:hover {
	color: #00B5D1
}
.uk-width-1-2 a {
	text-shadow: 1px 1px 1px #000
}
.uk-width-1-2 a:hover {
	color: #00B5D1;
}
.text-white {
	text-shadow: 1px 1px 1px #000;
}
.text-white:hover {
	color: #00B5D1;
}
.etkinlik-adi,
.etkinlik-yeri {
	font-family: 'Quicksand';
	background: -moz-linear-gradient(45deg, rgba(0, 0, 0, 0.65) 0%, rgba(0, 0, 0, 0) 100%);
	background: -webkit-linear-gradient(45deg, rgba(0, 0, 0, 0.65) 0%, rgba(0, 0, 0, 0) 100%);
	background: linear-gradient(45deg, rgba(0, 0, 0, 0.65) 0%, rgba(0, 0, 0, 0) 100%);
}
.uk-slider-container {
	background: none;
	filter: contrast(130%);
	-webkit-filter: contrast(130%);
}
.text-white {
	line-height: 25px;
}
div.menu-bot {
	background: rgba(0, 0, 0, .6)
}
.uk-dropdown,
.topMenu {
	-webkit-filter: drop-shadow(3px 3px 8px #222);
	filter: drop-shadow(3px 3px 8px #222);
}
.uk-dropdown {
	border: 1px solid #D1D700;
	background: rgba(0, 0, 0, .5)
}
.ana-slider>.slick-prev,
.ana-slider>.slick-next,
.ana-slider>.slick-dots {
	-webkit-filter: drop-shadow(3px 3px 2px #222);
	filter: drop-shadow(3px 3px 2px #222);
}
.hall,
.footer-bottom {
	text-shadow: 1px 1px 1px #000;
}
footer,
span.catalog-title,
footer a {
	font-size: 16px !important;
	font-family: Quicksand;
}
*>.catalog-title {
	color: #979797 !important;
	font-family: Quicksand;
	text-shadow: 1px 1px 1px #000;
}
input#mce-EMAIL.required.email {
	background: #000;
	color: #f2f2f2;
}
.bgCookie {
	background: -moz-linear-gradient(top, rgba(0, 0, 0, 0) 0%, rgba(0, 0, 0, 0.65) 39%, rgba(0, 0, 0, 0.65) 87%);
	/* FF3.6-15 */
	background: -webkit-linear-gradient(top, rgba(0, 0, 0, 0) 0%, rgba(0, 0, 0, 0.65) 39%, rgba(0, 0, 0, 0.65) 87%);
	/* Chrome10-25,Safari5.1-6 */
	background: linear-gradient(to bottom, rgba(0, 0, 0, 0) 0%, rgba(0, 0, 0, 0.65) 39%, rgba(0, 0, 0, 0.65) 87%);
	/* W3C, IE10+, FF16+, Chrome26+, Opera12+, Safari7+ */
}
input#mc-embedded-subscribe.button,
button#iletisimBtn.text-white {
	background: #A4AA40;
	border: 1px solid #3D3F18;
	background: hsla(63, 45%, 46%, 1);
	background: radial-gradient(circle, hsla(63, 45%, 46%, 1) 0%, hsla(64, 47%, 28%, 1) 100%);
	background: -moz-radial-gradient(circle, hsla(63, 45%, 46%, 1) 0%, hsla(64, 47%, 28%, 1) 100%);
	background: -webkit-radial-gradient(circle, hsla(63, 45%, 46%, 1) 0%, hsla(64, 47%, 28%, 1) 100%);
}
input#mc-embedded-subscribe.button:hover,
button#iletisimBtn.text-white:hover {
	border: 1px solid #161608;
}
footer {
	background: hsla(0, 0%, 11%, 1);
	background: radial-gradient(circle, hsla(0, 0%, 11%, 1) 0%, hsla(0, 0%, 38%, 1) 100%);
	background: -moz-radial-gradient(circle, hsla(0, 0%, 11%, 1) 0%, hsla(0, 0%, 38%, 1) 100%);
	background: -webkit-radial-gradient(circle, hsla(0, 0%, 11%, 1) 0%, hsla(0, 0%, 38%, 1) 100%);
}
footer input,
footer textarea,
input#mce-EMAIL.required.email {
	background: hsla(0, 0%, 11%, 1);
	background: radial-gradient(circle, hsla(0, 0%, 11%, 1) 0%, hsla(0, 0%, 0%, 1) 100%);
	background: -moz-radial-gradient(circle, hsla(0, 0%, 11%, 1) 0%, hsla(0, 0%, 0%, 1) 100%);
	background: -webkit-radial-gradient(circle, hsla(0, 0%, 11%, 1) 0%, hsla(0, 0%, 0%, 1) 100%);
}
footer input::placeholder,
footer textarea::placeholder,
input#mce-EMAIL.required.email::placeholder {
	opacity: 0.5;
	color: #424242;
}
.sec-ik-4 .right {
	justify-content: flex-start;
}
.megamenu {
	background: hsla(0, 0%, 11%, 1);
	background: radial-gradient(circle, hsla(0, 0%, 11%, 1) 0%, hsla(0, 0%, 0%, 1) 100%);
	background: -moz-radial-gradient(circle, hsla(0, 0%, 11%, 1) 0%, hsla(0, 0%, 0%, 1) 100%);
	background: -webkit-radial-gradient(circle, hsla(0, 0%, 11%, 1) 0%, hsla(0, 0%, 0%, 1) 100%);
}

}
